import React from 'react';
import Home from './Components/Home'
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";


function App() {
  return (
    <div>
      <Router>
      <Switch>
          <Route  path="/" component={Home} exact />
      </Switch>{" "}
    </Router>
    </div>
  );
}

export default App;
